require("regenerator-runtime/runtime");
const Runtime = require('../../engine/runtime');

const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const Cast = require('../../util/cast');
const formatMessage = require('format-message');
const Video = require('../../io/video');

//const handpose = require('@tensorflow-models/handpose');
const handPoseDetection = require('@tensorflow-models/hand-pose-detection');

const posenet = require('@tensorflow-models/posenet');

function friendlyRound(amount) {
    return Number(amount).toFixed(2);
}

/**
 * Icon svg to be displayed in the blocks category menu, encoded as a data URI.
 * @type {string}
 */
// eslint-disable-next-line max-len
const menuIconURI = 'data:image/png;base64,';

/**
 * Icon svg to be displayed at the left edge of each extension block, encoded as a data URI.
 * @type {string}
 */
// eslint-disable-next-line max-len
const blockIconURI = 'data:image/png;base64,';

/**
 * Sensor attribute video sensor block should report.
 * @readonly
 * @enum {string}
 */
const SensingAttribute = {
    /** The amount of motion. */
    MOTION: 'motion',

    /** The direction of the motion. */
    DIRECTION: 'direction'
};

/**
 * Subject video sensor block should report for.
 * @readonly
 * @enum {string}
 */
const SensingSubject = {
    /** The sensor traits of the whole stage. */
    STAGE: 'Stage',

    /** The senosr traits of the area overlapped by this sprite. */
    SPRITE: 'this sprite'
};

/**
 * States the video sensing activity can be set to.
 * @readonly
 * @enum {string}
 */
const VideoState = {
    /** Video turned off. */
    OFF: 'off',

    /** Video turned on with default y axis mirroring. */
    ON: 'on',

    /** Video turned on without default y axis mirroring. */
    ON_FLIPPED: 'on-flipped'
};


const EXTENSION_ID = 'poseHand';

/**
 * Class for the motion-related blocks in Scratch 3.0
 * @param {Runtime} runtime - the runtime instantiating this block package.
 * @constructor
 */
class Scratch3PoseNetBlocks {
    constructor (runtime) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.runtime = runtime;

        this.runtime.registerPeripheralExtension(EXTENSION_ID, this);
        this.runtime.connectPeripheral(EXTENSION_ID, 0);
        this.runtime.emit(this.runtime.constructor.PERIPHERAL_CONNECTED);

        /**
         * A flag to determine if this extension has been installed in a project.
         * It is set to false the first time getInfo is run.
         * @type {boolean}
         */
        this.firstInstall = true;

        if (this.runtime.ioDevices) {
            this.runtime.on(Runtime.PROJECT_LOADED, this.projectStarted.bind(this));
            this.runtime.on(Runtime.PROJECT_RUN_START, this.reset.bind(this));
            this._loop();
        }
    }

    /**
     * After analyzing a frame the amount of milliseconds until another frame
     * is analyzed.
     * @type {number}
     */
    static get INTERVAL () {
        return 33;
    }

    /**
     * Dimensions the video stream is analyzed at after its rendered to the
     * sample canvas.
     * @type {Array.<number>}
     */
    static get DIMENSIONS () {
        return [480, 360];
    }

    /**
     * The key to load & store a target's motion-related state.
     * @type {string}
     */
    static get STATE_KEY () {
        return 'Scratch.pose_hand';
    }

    /**
     * The default motion-related state, to be used when a target has no existing motion state.
     * @type {MotionState}
     */
    static get DEFAULT_MOTION_STATE () {
        return {
            motionFrameNumber: 0,
            motionAmount: 0,
            motionDirection: 0
        };
    }

    /**
     * The transparency setting of the video preview stored in a value
     * accessible by any object connected to the virtual machine.
     * @type {number}
     */
    get globalVideoTransparency () {
        const stage = this.runtime.getTargetForStage();
        if (stage) {
            return stage.videoTransparency;
        }
        return 50;
    }

    set globalVideoTransparency (transparency) {
        const stage = this.runtime.getTargetForStage();
        if (stage) {
            stage.videoTransparency = transparency;
        }
        return transparency;
    }

    /**
     * The video state of the video preview stored in a value accessible by any
     * object connected to the virtual machine.
     * @type {number}
     */
    get globalVideoState () {
        const stage = this.runtime.getTargetForStage();
        if (stage) {
            return stage.videoState;
        }
        // Though the default value for the stage is normally 'on', we need to default
        // to 'off' here to prevent the video device from briefly activating
        // while waiting for stage targets to be installed that say it should be off
        return VideoState.OFF;
    }

    set globalVideoState (state) {
        const stage = this.runtime.getTargetForStage();
        if (stage) {
            stage.videoState = state;
        }
        return state;
    }

    /**
     * Get the latest values for video transparency and state,
     * and set the video device to use them.
     */
    projectStarted () {
        this.setVideoTransparency({
            TRANSPARENCY: this.globalVideoTransparency
        });
        this.videoToggle({
            VIDEO_STATE: this.globalVideoState
        });
    }

    reset () {
    }

    isConnected() {
        return !!this.handPoseState && this.handPoseState.length > 0;
    }

    scan() {
    }

    connect() {
    }

    async _loop () {
        while (true) {
            this._frame = this.runtime.ioDevices.video.getFrame({
                format: Video.FORMAT_IMAGE_DATA,
                dimensions: Scratch3PoseNetBlocks.DIMENSIONS
            });
            const time = +new Date();
            const estimateThrottleTimeout = (+new Date() - time) / 4;
            await new Promise(r => setTimeout(r, estimateThrottleTimeout));
        }
    }

    /**
     * Create data for a menu in scratch-blocks format, consisting of an array
     * of objects with text and value properties. The text is a translated
     * string, and the value is one-indexed.
     * @param {object[]} info - An array of info objects each having a name
     *   property.
     * @return {array} - An array of objects with text and value properties.
     * @private
     */
    _buildMenu (info) {
        return info.map((entry, index) => {
            const obj = {};
            obj.text = entry.name;
            obj.value = entry.value || String(index + 1);
            return obj;
        });
    }

    static get SensingAttribute () {
        return SensingAttribute;
    }

    /**
     * An array of choices of whether a reporter should return the frame's
     * motion amount or direction.
     * @type {object[]}
     * @param {string} name - the translatable name to display in sensor
     *   attribute menu
     * @param {string} value - the serializable value of the attribute
     */
    get ATTRIBUTE_INFO () {
        return [
            {
                name: formatMessage({
                    id: 'videoSensing.motion',
                    default: 'motion',
                    description: 'Attribute for the "video [ATTRIBUTE] on [SUBJECT]" block'
                }),
                value: SensingAttribute.MOTION
            },
            {
                name: formatMessage({
                    id: 'videoSensing.direction',
                    default: 'direction',
                    description: 'Attribute for the "video [ATTRIBUTE] on [SUBJECT]" block'
                }),
                value: SensingAttribute.DIRECTION
            }
        ];
    }

    static get SensingSubject () {
        return SensingSubject;
    }

    /**
     * An array of info about the subject choices.
     * @type {object[]}
     * @param {string} name - the translatable name to display in the subject menu
     * @param {string} value - the serializable value of the subject
     */
    get SUBJECT_INFO () {
        return [
            {
                name: formatMessage({
                    id: 'videoSensing.sprite',
                    default: 'sprite',
                    description: 'Subject for the "video [ATTRIBUTE] on [SUBJECT]" block'
                }),
                value: SensingSubject.SPRITE
            },
            {
                name: formatMessage({
                    id: 'videoSensing.stage',
                    default: 'stage',
                    description: 'Subject for the "video [ATTRIBUTE] on [SUBJECT]" block'
                }),
                value: SensingSubject.STAGE
            }
        ];
    }

    /**
     * States the video sensing activity can be set to.
     * @readonly
     * @enum {string}
     */
    static get VideoState () {
        return VideoState;
    }

    /**
     * An array of info on video state options for the "turn video [STATE]" block.
     * @type {object[]}
     * @param {string} name - the translatable name to display in the video state menu
     * @param {string} value - the serializable value stored in the block
     */
    get VIDEO_STATE_INFO () {
        return [
            {
                name: formatMessage({
                    id: 'videoSensing.off',
                    default: 'off',
                    description: 'Option for the "turn video [STATE]" block'
                }),
                value: VideoState.OFF
            },
            {
                name: formatMessage({
                    id: 'videoSensing.on',
                    default: 'on',
                    description: 'Option for the "turn video [STATE]" block'
                }),
                value: VideoState.ON
            },
            {
                name: formatMessage({
                    id: 'videoSensing.onFlipped',
                    default: 'on flipped',
                    description: 'Option for the "turn video [STATE]" block that causes the video to be flipped' +
                        ' horizontally (reversed as in a mirror)'
                }),
                value: VideoState.ON_FLIPPED
            }
        ];
    }

    /**
     * @returns {object} metadata for this extension and its blocks.
     */
    getInfo () {
        // Set the video display properties to defaults the first time
        // getInfo is run. This turns on the video device when it is
        // first added to a project, and is overwritten by a PROJECT_LOADED
        // event listener that later calls updateVideoDisplay
        if (this.firstInstall) {
            this.globalVideoState = VideoState.ON;
            this.globalVideoTransparency = 50;
            this.projectStarted();
            this.firstInstall = false;
            this._detector = null;
        }

        // Return extension definition
        return {
            id: EXTENSION_ID,
            name: formatMessage({
                id: 'pose_hand.categoryName',
                default: '   ',
                description: 'Label for Hand Sensing category'
            }),
            showStatusButton: true,
            blockIconURI: blockIconURI,
            menuIconURI: menuIconURI,
            blocks: [
                {
                    opcode: "detectVideo",
                    text: '  ',
                    blockType: BlockType.COMMAND,
                    arguments: {
                    },
                },
                {
                    opcode: "returnHandExist",
                    text: ' [YESNO]',
                    blockType: BlockType.BOOLEAN,
                    arguments: {
                        YESNO: {
                            type: ArgumentType.STRING,
                            defaultValue: 'exist',
                            menu: 'yesnomenu'
                        },
                    },
                },
                {
                    opcode: "returnHandness",
                    text: '  ',
                    blockType: BlockType.REPORTER,
                    arguments: {
                    },
                },
                {
                    opcode: "returnHandPosition",
                    text: '[HAND_PART] [HAND_SUB_PART] [XY] ',
                    blockType: BlockType.REPORTER,
                    arguments: {
                        HAND_PART: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 1,
                            menu: 'HAND_PART'
                        },
                        HAND_SUB_PART: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 4,
                            menu: 'HAND_SUB_PART'
                        },
                        XY: {
                            type: ArgumentType.STRING,
                            defaultValue: 'x',
                            menu: 'xymenu'
                        },
                    },
                },
                {
                    opcode: 'returnPartPosition',
                    text: '[PART] [XY] ',
                    blockType: BlockType.REPORTER,
                    arguments: {
                        PART: {
                            type: ArgumentType.STRING,
                            defaultValue: 'rightShoulder',
                            menu: 'PART'
                        },
                        XY: {
                            type: ArgumentType.STRING,
                            defaultValue: 'x',
                            menu: 'xymenu'
                        },
                    },
                },
                '---',
                {
                    opcode: 'videoToggle',
                    text: formatMessage({
                        id: 'videoSensing.videoToggle',
                        default: 'turn video [VIDEO_STATE]',
                        description: 'Controls display of the video preview layer'
                    }),
                    arguments: {
                        VIDEO_STATE: {
                            type: ArgumentType.NUMBER,
                            menu: 'VIDEO_STATE',
                            defaultValue: VideoState.OFF
                        }
                    }
                },
                {
                    opcode: 'setVideoTransparency',
                    text: formatMessage({
                        id: 'videoSensing.setVideoTransparency',
                        default: 'set video transparency to [TRANSPARENCY]',
                        description: 'Controls transparency of the video preview layer'
                    }),
                    arguments: {
                        TRANSPARENCY: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 50
                        }
                    }
                },
                '---',
            ],
            menus: {
                yesnomenu: {
                    acceptReporters: true,
                    items: [
                        {text: '', value: 'exist'},
                        {text: ' ', value: 'noexist'},
                    ]
                },
                xymenu: {
                    acceptReporters: true,
                    items: [
                        {text: 'X', value: 'x'},
                        {text: 'Y', value: 'y'},
                    ]
                },
                HAND_PART: {
                    acceptReporters: true,
                    items: [
                        {text: '', value: '1'},
                        {text: '', value: '2'},
                        {text: '', value: '3'},
                        {text: '', value: '4'},
                        {text: '', value: '5'},
                        // {text: 'base of palm', value: 'palmBase'},
                    ]
                },
                HAND_SUB_PART: {
                    acceptReporters: true,
                    items: [
                        {text: '', value: 1},
                        {text: ' ', value: 2},
                        {text: ' ', value: 3},
                        {text: '', value: 4},
                    ]
                },
                PART: {
                    acceptReporters: true,
                    items: [
                        {text: '', value: 'nose'},
                        {text: ' ', value: 'leftEye'},
                        {text: ' ', value: 'rightEye'},
                        {text: ' ', value: 'leftEar'},
                        {text: ' ', value: 'rightEar'},
                        {text: ' ', value: 'leftShoulder'},
                        {text: ' ', value: 'rightShoulder'},
                        {text: ' ', value: 'leftElbow'},
                        {text: ' ', value: 'rightElbow'},
                        {text: ' ', value: 'leftWrist'},
                        {text: ' ', value: 'rightWrist'},
                        {text: ' ', value: 'leftHip'},
                        {text: ' ', value: 'rightHip'},
                        {text: ' ', value: 'leftKnee'},
                        {text: ' ', value: 'rightKnee'},
                        {text: ' ', value: 'leftAnkle'},
                        {text: ' ', value: 'rightAnkle'},
                    ]
                },
                ATTRIBUTE: {
                    acceptReporters: true,
                    items: this._buildMenu(this.ATTRIBUTE_INFO)
                },
                SUBJECT: {
                    acceptReporters: true,
                    items: this._buildMenu(this.SUBJECT_INFO)
                },
                VIDEO_STATE: {
                    acceptReporters: true,
                    items: this._buildMenu(this.VIDEO_STATE_INFO)
                }
            }
        };
    }


    async detectVideo() {
        if (this._frame) {
            this.handPoseState = await this.estimateHandOnImage(this._frame);
            console.log('handPoseState: ', this.handPoseState);
            if (this.handPoseState) {
                this.runtime.emit(this.runtime.constructor.PERIPHERAL_CONNECTED);
            } else {
                this.runtime.emit(this.runtime.constructor.PERIPHERAL_DISCONNECTED);
            }


            this.bodyPoseState = await this.estimatePoseOnImage(this._frame); 
            console.log('bodyPoseState: ', this.bodyPoseState);
            if (this.bodyPoseState) {
                this.runtime.emit(this.runtime.constructor.PERIPHERAL_CONNECTED);
            } else {
                this.runtime.emit(this.runtime.constructor.PERIPHERAL_DISCONNECTED);
            }
        }
    }

    async estimateHandOnImage(imageElement) {
        // load the posenet model from a checkpoint
        await this.ensureHandModelLoaded();
        return await this._detector.estimateHands(imageElement);
    }

    async ensureHandModelLoaded() {
        if (!this._detector) {
            const model = handPoseDetection.SupportedModels.MediaPipeHands;
            const detectorConfig = {
                runtime: 'tfjs',
                solutionPath: 'https://cdn.jsdelivr.net/npm/@mediapipe/hands',
                modelType: 'full'
            }
            this._detector = await handPoseDetection.createDetector(model, detectorConfig);
        }
        console.log('detector');
        console.log(this._detector);
        return this._detector;
    }

    async estimatePoseOnImage(imageElement) {
        // load the posenet model from a checkpoint
        const bodyModel = await this.ensureBodyModelLoaded();
        return await bodyModel.estimateSinglePose(imageElement, {
            flipHorizontal: false
        });
    }

    async ensureBodyModelLoaded() {
        if (!this._bodyModel) {
            this._bodyModel = await posenet.load();
        }
        return this._bodyModel;
    }


    async returnHandExist(args) {
        if (args.YESNO === 'exist') {
            if(this.handPoseState[0].length === 0) {
                return false;
            }
            else {
                return true;
            }
        }
        else if (args.YESNO === 'noexist') {
            if(this.handPoseState[0].length === 0) {
                return true;
            }
            else {
                return false;
            }
        }
    }

    async returnHandness(args) {
        return this.handPoseState[0].handedness;
    }

    async returnHandPosition(args) {
        const order = 4 * Number(args.HAND_PART - 1) + Number(args.HAND_SUB_PART);
        console.log(order);
        const keypoints = this.handPoseState[0].keypoints[order];
        console.log(keypoints);
        const x = keypoints.x;
        const y = keypoints.y;
        //const {x: scratchX, y: scratchY} = this.tfCoordsToScratch({x, y, z});
        if(args.XY == 'x'){
            return x - 250;
        }
        else if(args.XY == 'y'){
            return 200 - y;
        }
    }

    async returnPartPosition(args) {
        if (this.bodyPoseState) {
            const {x, y} = this.tfCoordsToScratch(this.bodyPoseState.keypoints.find(point => point.part === args['PART']).position);
            if(args.XY == 'x'){
                return x;
            }
            else if(args.XY == 'y'){
                return y;
            }
        }
    }

    tfCoordsToScratch({x, y}) {
        return {x: x - 250, y: 200 - y};
    }

    /**
     * A scratch command block handle that configures the video state from
     * passed arguments.
     * @param {object} args - the block arguments
     * @param {VideoState} args.VIDEO_STATE - the video state to set the device to
     */
    videoToggle (args) {
        const state = args.VIDEO_STATE;
        this.globalVideoState = state;
        if (state === VideoState.OFF) {
            this.runtime.ioDevices.video.disableVideo();
        } else {
            this.runtime.ioDevices.video.enableVideo();
            // Mirror if state is ON. Do not mirror if state is ON_FLIPPED.
            this.runtime.ioDevices.video.mirror = state === VideoState.ON;
        }
    }

    /**
     * A scratch command block handle that configures the video preview's
     * transparency from passed arguments.
     * @param {object} args - the block arguments
     * @param {number} args.TRANSPARENCY - the transparency to set the video
     *   preview to
     */
    setVideoTransparency (args) {
        const transparency = Cast.toNumber(args.TRANSPARENCY);
        this.globalVideoTransparency = transparency;
        this.runtime.ioDevices.video.setPreviewGhost(transparency);
    }
}

module.exports = Scratch3PoseNetBlocks;
